def trailing_zeros(n):
    s = 0
    d = 5
    while d <= n:
        s += n // d
        d *= 5
    return s

low = 0
high = 5 * m
while low < high:
    mid = (low + high) // 2
    if trailing_zeros(mid) < m:
        low = mid + 1
    else:
        high = mid
if trailing_zeros(low) == m:
    res = [str(low + i) for i in range(5)]
    sys.stdout.write("5\n" + " ".join(res))
